    [],nt"num_tags": 3,nt"name": "back-bay-national-wildlife-refuge-refuge-narrative-report-january-april-1947",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Back Bay NWR
    outlines Refuge accomplishments from January through April of 1947. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. A progress report on field investigations and applied research is
    also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, and violations. N-R forms are attached.",nt"owner_org":
